We need to implement first some of the arithmetic operations and define field elements. We will show how to do it in Rust. use::std::ops::{Add, Sub, Mul, Div};
pub struct FieldPoint { num: u128, prime: u128,
} The first line imports the standard library (in particular, the operations of addition, subtraction, multiplication, and division), which will allow us to override these operators with the expressions we need to use in modular arithmetic. In the second line, we define a public structure named FieldPoint, which has two fields: num (a number in the range 0 to prime) and prime (this will give us the size and we will perform all operations modulo prime). For practical applications, we need to replace the unsigned integers u128 with appropriate variables that allow us to store large integers. We can now instantiate some methods over FieldPoint, such as how to create one or how to multiply or divide field elements. impl FieldPoint { pub fn new(num: u128, prime: u128) -> FieldPoint { if num > prime { panic!("Not a valid input for a field point, num should be nonnegative and less than prime, obtained {}", num); } else { FieldPoint {num:num, prime:prime} } }
} Methods are defined following the keyword impl and the name of the struct. We have a constructor for the FieldPoint, which takes two unsigned u128 integers. To define addition, we can implement the trait Add for FieldPoint in this way: impl Add for FieldPoint { type Output = Self; fn add(self, other: Self) -> Self { if self.prime == other.prime { FieldPoint {num: (self.num + other.num).rem_euclid(self.prime), prime: self.prime} } else { panic!("Cannot add these field points, different prime values {},{}",self.prime,other.prime); } }
} The addition is simply adding the num fields and if the result exceeds the modulus prime, we take the remainder of the Euclidean division between the sum and the modulus. Multiplication works in a similar way: impl Mul for FieldPoint { type Output = Self; fn mul(self, other: Self) -> Self { if self.prime == other.prime { FieldPoint {num: (self.num*other.num).rem_euclid(self.prime), prime: self.prime} } else { panic!("Cannot multiply these field points, different prime values, {},{}",self.prime,other.prime); } }
} We need to define integer powers of FieldElement. We can do it in a rather efficient way by squaring and taking the remainder: pub fn power(&self,index: u128) -> Self { if index == 0 { FieldPoint {num: 1u128, prime: self.prime} } else { let mut aux=index.rem_euclid(self.prime-1u128); let mut acc: u128 = 1; let mut base: u128 =self.num; while aux >0{ if aux%2 == 0 { base = (base*base).rem_euclid(self.prime); aux=aux/2u128; } else { acc = (acc*base).rem_euclid(self.prime); aux=aux-1u128; } } FieldPoint {num: acc, prime: self.prime} } } The power function takes a FieldElement and index, a u128. If the index is \( 0 \), the result is trivial and we output a FieldElement with num equal to \( 1 \). In any other case, we first reduce index (if index exceeds prime, we can take the remainder of index by prime-1 -this works when the modulus is prime, since Euler's theorem (to be presented soon) says that \( a^{p-1}\equiv 1 \pmod{p} \)-. A better version would reduce index by \( \phi(n) \)) (the function \( \phi\) is known as Euler's totient function) and store it in aux. We also define a variable to calculate the result acc and base, where we will repeatedly square and take the remainder of the num. We now focus on the squaring and the updating of the result: while aux >0{ if aux%2 == 0 { base = (base*base).rem_euclid(self.prime); aux=aux/2u128; } else { acc = (acc*base).rem_euclid(self.prime); aux=aux-1u128; }
} We will go decreasing the index stored in aux: if it is even (the first condition -this could be checked much faster, by inspecting the last bit of aux-), we divide aux by two and update base to the remainder of its square. If it is odd, then we proceed to update the result in acc and decrease aux by one (which means that in the next step it will be even). To convince ourselves, let's take a short numerical example, while we follow the instructions. Let's take prime as 11, num as 4, and index as 39. We set aux equal to the remainder of 39 and 10 (which is also \( \phi(11) \)). We get aux=9. Since \( 9>0 \), we go inside the while loop. \( 9 \) is odd, so acc=9 and aux=8. aux is even, so base=4*4=16; we have to reduce the number by taking the remainder by \( 11 \), so base=5 and aux=4. aux is even, so base=5*5=25 and we get base=3 and aux=2. aux is once again even, base=9 and aux=1. aux is odd, we get acc=9*4=36->3 and aux=0. Since aux=0, we jump outside the while loop and the function returns the FieldPoint (num=3,prime=11).
